// Pricing

export default class Pricing {
  // Constructor
  constructor(amount, currency) {
    if (typeof (amount) !== 'number') {
      TypeError('Amount must be a number');
    }
    this._amount = amount;

    if (!(currency instanceof Currency)) {
      TypeError('Currency must be an instance of Currency');
